  "BlackRockLedger01": {
    "flavor": "\"Damn, I always thought that being a first mate would be more exciting. I guess I shouldn't expect much from a mining expedition. Ever since we set off from Kingsport, all I've done is sit out on deck and watch the deckhands argue.\"",
    "icon": "626120659,0,626120659,0,626120659,0,626120659,0,626120659,0,0,0",
    "name": "The Black Rock Ledger, Page 4",
    "trivial": true
  },
  "BlackRockLedger02": {
    "flavor": "\"Haven't been able to get much sleep these past few days. Apparently my sea legs aren't as sturdy as I thought they'd be. I've vomited more times than I can count, and every time Captain Hanso offers me some ale, I have to come up with some excuse to decline.\"",
    "icon": "626120659,0,626120659,0,626120659,0,626120659,0,626120659,0,0,0",
    "name": "The Black Rock Ledger, Page 8",
    "trivial": true
  },
  "BlackRockLedger03": {
    "flavor": "\"After three straight days of this storm, I'm almost convinced that this ship has some sort of curse on it. Each week brings some new trouble that I have to deal with. I'm not sure what will give out first, the ship... or me.\"",
    "icon": "626120659,0,626120659,0,626120659,0,626120659,0,626120659,0,0,0",
    "name": "The Black Rock Ledger, Page 15",
    "trivial": true
  },
  "BlackRockLedger04": {
    "flavor": "\"Reyes tells me that it was some colossal wave that did the ship in. I was down below when it all happened. Several of us survived the wreck. The rest of them have gone off to try and figure out where the hell we are, as if any of that matters.\"",
    "icon": "626120659,0,626120659,0,626120659,0,626120659,0,626120659,0,0,0",
    "name": "The Black Rock Ledger, Page 16",
    "trivial": true
  },
  "BlackRockLedger05": {
    "flavor": "\"Madness, complete bloody madness. The captain has disappeared into the desert somewhere, and the rest of the survivors are convinced there's some sort of monster after us. I'm starting to think the crewmen that died in the wreck got the easy way out, lucky bastards.\"",
    "icon": "626120659,0,626120659,0,626120659,0,626120659,0,626120659,0,0,0",
    "name": "The Black Rock Ledger, Page 23",
    "trivial": true
  },
  "BlackRockLedger06": {
    "flavor": "\"All the rest of them are dead now... I'm the only one left. Strange deformed creatures attacked the wreck, where most of us were sleeping. I managed to get away safely... but I don't imagine it will be that way for long. I can hear them... giggling in the shadows, like this is some kind of game.\"\n\n-First Mate McMahon",
    "icon": "626120659,0,626120659,0,626120659,0,626120659,0,626120659,0,0,0",
    "name": "The Black Rock Ledger, Page 42",
    "trivial": true
  },
