  "CraftingReagent_Legendary_Unique_CruShield_101_x1": {
    "flavor": "In his last moments of life, Mastersmith Iach could not help but laugh. Meeting his fate at the hands of shield-wielding skeletons seemed appropriate, somehow.",
    "icon": "1149769151,0,1149769151,0,1149769151,0,1149769151,0,1149769151,0,1149769151,0",
    "name": "Woven Plate",
    "trivial": true
  },
  "CraftingReagent_Legendary_Unique_Dagger_006_x1": {
    "flavor": "The dark cultists of the Coven channeled such great amounts of evil magic that their blood became tainted. Unbeknownst to them, this was intended, as they were always meant to be sacrificed to feed their deceitful master, Belial.",
    "icon": "2057181994,0,2057181994,0,2057181994,0,2057181994,0,2057181994,0,2057181994,0",
    "name": "Cultist Blood",
    "trivial": true
  },
  "CraftingReagent_Legendary_Unique_Fist_004_x1": {
    "flavor": "\"Seeing as how the mythical demon-claw mace is most often represented as appearing similar to the claw of a tormented stinger, many fools believe one to be a necessary ingredient to construct the mace of legends. There are many reasons I can cite as to why this is patently ridiculous, but I need only one: It is surely impossible to craft a demon claw.\" —Abd al-Hazir",
    "icon": "3171180692,0,3171180692,0,3171180692,0,3171180692,0,3171180692,0,3171180692,0",
    "name": "Bloody Pincer",
    "trivial": true
  },
  "CraftingReagent_Legendary_Unique_Flail_1H_101_x1": {
    "flavor": "When Cornelius took the throne, he sought to distance himself from the insurgents by adopting the sign of the bear—even tasking the royal armorer with melting down the hilt of his sword. The armorer, however, replaced the wolf’s head hilt with a bear head of inferior materials. Unfortunately for him, he was overtaken by fallen hounds when en route to sell the original.",
    "icon": "3722875740,0,3722875740,0,3722875740,0,3722875740,0,3722875740,0,3722875740,0",
    "name": "Hilt of the Silver Wolf",
    "trivial": true
  },
  "CraftingReagent_Legendary_Unique_Gloves_001_x1": {
    "flavor": "\"Written by Lord Pender himself, this unique tome contains complex algorithms, visionary theories, and obscure philosophy. Sadly, it was stolen by drunken adventurers from Caldeum’s Great Library. Since it never appeared on black market—or anywhere else, for that matter, we can only assume the thieves met an untimely end.\"  —Deckard Cain",
    "icon": "1826682987,0,1826682987,0,1826682987,0,1826682987,0,1826682987,0,1826682987,0",
    "name": "Adventurer's Journal",
    "trivial": true
  },
  "CraftingReagent_Legendary_Unique_HandXBow_006_x1": {
    "flavor": "Skeletal archers are known to use these wooden stakes to craft arrows.",
    "icon": "3647044859,0,3647044859,0,3647044859,0,3647044859,0,3647044859,0,3647044859,0",
    "name": "Wooden Stake",
    "trivial": true
  },
  "CraftingReagent_Legendary_Unique_Helm_011_x1": {
    "flavor": "\"Legend claims that colossal golgors were drawn to the magic contained in the late General Raylend's skull, and that his skull is needed to reactivate the power of the Helm of Rule. Contrary to even his own beliefs, the magic resided within Raylend himself, not in his helmet. Obviously, we now know that this is simply a fanciful tale, as colossal golgors do not actually exist.\" —Abd al-Hazir",
    "icon": "1355566978,0,1355566978,0,1355566978,0,1355566978,0,1355566978,0,1355566978,0",
    "name": "Skull of Raylend",
    "trivial": true
  },
